import React from "react";

const ProgressBar = () => {


    return(
        <section className="progressbar" >
            <section className="progress"></section>
            {/* <section className="progress-step progress-step-active" data-title="intro"></section> */}
            
            <section>
                 <section className="progress-step" data-title="Booking Details"></section>
             <section className="progress-step" data-title="Your Details"></section>
            </section>
            

             
        </section>
    )
}
export default ProgressBar
